import React, { useState, useEffect } from 'react';
import { Box, Paper, Typography, Button, Grid, Divider } from '@mui/material';
import { QRCode } from 'react-qrcode-logo';
import * as htmlToImage from 'html-to-image';
import jsPDF from 'jspdf';

const Summary = ({ totalSummary, foodItems }) => {
  const [qrCodeValue, setQrCodeValue] = useState("https://example.com/payment");

  // Function to save the summary as an image
  const saveAsImage = () => {
    const summaryNode = document.getElementById('summary-slip');
    htmlToImage.toPng(summaryNode)
      .then(function (dataUrl) {
        const link = document.createElement('a');
        link.download = 'summary-slip.png';
        link.href = dataUrl;
        link.click();
      });
  };

  // Function to save the summary as a PDF
  const saveAsPdf = () => {
    const summaryNode = document.getElementById('summary-slip');
    htmlToImage.toPng(summaryNode)
      .then(function (dataUrl) {
        const pdf = new jsPDF();
        pdf.addImage(dataUrl, 'PNG', 10, 10, 180, 240);
        pdf.save('summary-slip.pdf');
      });
  };

  return (
    <Box
      sx={{
        p: 3,
        backgroundColor: '#f4f4f4',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        minHeight: '100vh',
      }}
    >
      <Paper
        id="summary-slip"
        elevation={3}
        sx={{
          p: 4,
          borderRadius: 4,
          maxWidth: 600,
          width: '100%',
          backgroundColor: 'white',
        }}
      >
        <Typography variant="h4" gutterBottom align="center" sx={{ fontWeight: 'bold' }}>
          Payment Summary Slip
        </Typography>

        <Divider sx={{ mb: 2 }} />

        {/* Display Food Items and Prices */}
        {foodItems.map((food, index) => (
          <Box key={index} sx={{ mb: 2 }}>
            <Typography variant="h6" sx={{ fontWeight: 'bold' }}>
              {food.name}
            </Typography>
            <Typography variant="body1" sx={{ color: 'gray' }}>
              {food.price.toFixed(2)} Baht
            </Typography>
            <Typography variant="body2">
              Shared by: {food.participants.join(', ')}
            </Typography>
          </Box>
        ))}

        <Divider sx={{ my: 2 }} />

        {/* Total per participant */}
        <Box sx={{ mb: 2 }}>
          <Typography variant="h5" gutterBottom>
            Total Amount Owed
          </Typography>
          {Object.keys(totalSummary).map((participant) => (
            <Typography key={participant} variant="body1" sx={{ mb: 1 }}>
              {participant}: <strong>{totalSummary[participant].toFixed(2)} Baht</strong>
            </Typography>
          ))}
        </Box>

        {/* QR Code Section */}
        <Box
          sx={{
            display: 'flex',
            justifyContent: 'center',
            alignItems: 'center',
            my: 3,
          }}
        >
          <QRCode value={qrCodeValue} size={120} />
        </Box>

        <Typography variant="body2" align="center" sx={{ color: 'gray', mb: 2 }}>
          Scan the QR code to complete the payment.
        </Typography>

        {/* Save Buttons */}
        <Grid container spacing={2}>
          <Grid item xs={6}>
            <Button
              variant="contained"
              color="primary"
              fullWidth
              onClick={saveAsImage}
            >
              Save as Image
            </Button>
          </Grid>
          <Grid item xs={6}>
            <Button
              variant="contained"
              color="secondary"
              fullWidth
              onClick={saveAsPdf}
            >
              Save as PDF
            </Button>
          </Grid>
        </Grid>
      </Paper>
    </Box>
  );
};

export default Summary;
